  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lake Zahl
  NWR outlines Refuge accomplishments during the 1964 calendar year. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover conditions during the year. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, predators, rodents, and reptiles-
  is also covered. The Refuge development and maintenance section discusses plantings
  and collections and receipts. Resource management is outlined; topics include grazing.
  The public relations section of the report describes Refuge visitors, Refuge participation,
  and violations. Items of interest and N-R forms are attached.\",\n\t\"license_title\":
